	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;

	Star STRUCT
		x_position DWORD ?
		y_position DWORD ?
	Star ENDS
	
	myStar Star<300,100>

	Bird STRUCT
		x_position DWORD ?
		y_position DWORD ?
	Bird ENDS

	myBird Bird<300, 370>

	Slingy STRUCT
		x_position DWORD ?
		y_position DWORD ?
	Slingy ENDS

	mySling Slingy<300, 400>

	background STRUCT
		x_position DWORD ? ;; will actually stay the same
		y_position DWORD ?
	background ENDS

	myBackground background<300, 200>

	background2 STRUCT
		x_position DWORD ?
		y_position DWORD ?
	background2 ENDS

	myBackground2 background2<300, 650>

	collision_words BYTE "BOOM!", 0
	pause_words BYTE "PAUSED", 0
	debug_words BYTE "REACHED HERE", 0

	game_over_words BYTE "Time is up! "

	lost_words BYTE "You got 0 points so you lost! The pigs won. Better luck next time.", 0

	score DWORD 0
	update_score DWORD 0
	fmtStrScore BYTE "Score: %d", 0
	fmtStrScoreFinal BYTE "You won! You defeated the pigs! You're final score is: %d", 0
	outStrScore BYTE 256 DUP(0)

	time_left DWORD 1000
	fmtStrTime BYTE "Time left: %d", 0
	outStrTime BYTE 256 DUP(0)

	exploded DWORD 1 ;; initially not exploded

	moving_right_bool DWORD 1 ;; start out w/ moving_right is true

	speed DWORD 5

	clicked DWORD 0 ;; start out w/clicked false (not clicked)
	pause_var DWORD 0 ;; initially game is NOT paused


.CODE
	

GameInit PROC uses ebx ecx edx
	INVOKE PlaySound, offset music, 0, SND_FILENAME OR SND_ASYNC OR SND_LOOP
	ret         ;; Do not delete this line!!!
GameInit ENDP

ResetScreen PROC uses ebx ecx edx edi esi
	mov eax, 0 ;;clear eax
	mov edi, ScreenBitsPtr ;; initial address of first pixel
	mov ecx, 307200 ;; counter -- size of screen bits array
	REP STOSB
	INVOKE DrawStarField
	lea ebx, cloud_background_big
	INVOKE BasicBlit, ebx, myBackground.x_position, myBackground.y_position
	INVOKE BasicBlit, ebx, myBackground2.x_position, myBackground2.y_position

	cmp myBackground.y_position, -300
	;; means off the screen at this point (from the top)
	jle reset_y1_pos
	cmp myBackground2.y_position, -300
	;; means off the screen at this point (from the top)
	jl reset_y2_pos

	cmp myBackground.y_position, 20
	jg next_check ;;;;;;;;;;;;;; means still on  the screen
	;; when off the screen, invoke new background
	;INVOKE DrawStr, OFFSET debug_words, 100, 100, 0ffh
	lea ebx, cloud_background_big;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
	INVOKE BasicBlit, ebx, myBackground2.x_position, myBackground2.y_position
	;INVOKE BasicBlit, ebx, 300, 650

next_check:
	cmp myBackground2.y_position, 20
	jg bot ;; means still on screen, just keep going
	lea ebx, cloud_background_big
	INVOKE BasicBlit, ebx, myBackground.x_position, myBackground.y_position
	jmp bot

reset_y1_pos:
	INVOKE BasicBlit, ebx, myBackground2.x_position, myBackground2.y_position
	mov eax, 650
	mov myBackground.y_position, eax
	jmp bot
reset_y2_pos:
	INVOKE BasicBlit, ebx, myBackground.x_position, myBackground.y_position
	mov eax, 650
	mov myBackground2.y_position, eax

bot:
	sub myBackground.y_position, 3
	sub myBackground2.y_position, 3

	rdtsc
	mov ebx, score
	cmp update_score, ebx
	jle dont_increment
;; if greater than: need to increment by 1
	inc score

dont_increment:
	push score
	push offset fmtStrScore
	push offset outStrScore
	call wsprintf
	add esp, 12
	INVOKE DrawStr, offset outStrScore, 30, 45, 255

	mov ebx, score
	mov update_score, ebx

	push time_left
	push offset fmtStrTime
	push offset outStrTime
	call wsprintf
	add esp, 12
	INVOKE DrawStr, offset outStrTime, 30, 30, 255
	dec time_left
	
	ret

ResetScreen ENDP


GamePlay PROC uses ebx ecx edx edi esi
	cmp time_left, 0
	jle game_over_screen

	cmp KeyPress, 20h
	je check_pause ;; if space is clicked, check current state of pause
	;; otherwise, if space is not clicked, check if paused or not
	cmp pause_var, 0
	je continue_playing_game ;; if zero, continue playing game. 
	jmp done ;; otherwise, it is paused, and need to do another cycle. 

check_pause:
	cmp pause_var, 0 ;; not paused initially--> gotta pause
	je pause_screen
	;; otherwise its paused initially --> gotta continue playing game
	jmp play_game
pause_screen:
	mov pause_var, 1
	INVOKE DrawStarField
	INVOKE DrawStr, OFFSET pause_words, 290, 30, 0ffh ;; this works hm

	jmp done

play_game:
	mov pause_var, 0
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;; SCORE THINGS ;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;
continue_playing_game:
start:
	mov edi, moving_right_bool ;; start out moving_right -- edi = 1
	cmp edi, 1
	jne moving_left

;; if moving_right is true, then move right!
moving_right:
	; if moving_right is true, add 5
	mov esi, speed
	add myStar.x_position, esi
	lea ecx, purple_pig
	INVOKE ResetScreen
	lea ebx, angryBird
	INVOKE BasicBlit, ebx, myBird.x_position, myBird.y_position
	lea edx, slingshot
	INVOKE BasicBlit, edx, mySling.x_position, mySling.y_position
	INVOKE BasicBlit, ecx, myStar.x_position, myStar.y_position
	jmp check

moving_left:
	;;jmp check
	;; else if it's not true subtract 5
	mov esi, speed
	sub myStar.x_position, esi
	lea ecx, purple_pig
	INVOKE ResetScreen
	;INVOKE DrawStarField
	INVOKE BasicBlit, ecx, myStar.x_position, myStar.y_position
	lea ebx, angryBird
	INVOKE BasicBlit, ebx, myBird.x_position, myBird.y_position
	lea edx, slingshot
	INVOKE BasicBlit, edx, mySling.x_position, mySling.y_position

check:
	cmp myStar.x_position, 639
	jge star_go_left ;; gotta go left
	;; else keep going right
	cmp myStar.x_position, 0
	jle star_go_right;; gotta go right now
	;mov edi, 1
	jmp key_presses

star_go_right:
	mov edi, 1
	mov moving_right_bool, 1
	add esi, 1
	mov speed, esi
	jmp start

star_go_left:
	mov edi, 0
	mov moving_right_bool, 0
	add esi, 1
	mov speed, esi
	jmp start

key_presses:
	cmp clicked, 1
	je go_up
	cmp KeyPress, 27h
	je go_right
	cmp KeyPress, 25h
	je go_left

	;; go up: actually mouse press
	lea edx, MouseStatus
	cmp (MouseInfo PTR[edx]).buttons, MK_LBUTTON
	je go_up
	cmp (MouseInfo PTR[edx]).buttons, MK_RBUTTON
	je next_check
	;je go_down
	jmp done

next_check:
	cmp clicked, 0
	je go_up
	; else it was already clicked
	jmp done


;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;

go_right:
	cmp myBird.x_position, 639
	jge done ;;if x_position if off screen on right side, can't go that way. can only go left. 
	;; else you CAN go right:
	add myBird.x_position, 5
	lea ebx, angryBird
	INVOKE BasicBlit, ebx, myBird.x_position, myBird.y_position
	add mySling.x_position, 5
	lea edx, slingshot
	INVOKE BasicBlit, edx, mySling.x_position, mySling.y_position
	INVOKE ResetScreen

	lea esi, purple_pig
	INVOKE BasicBlit, esi, myStar.x_position, myStar.y_position
	INVOKE BasicBlit, ebx, myBird.x_position, myBird.y_position
	INVOKE BasicBlit, edx, mySling.x_position, mySling.y_position

	jmp done

go_left:
	cmp myBird.x_position, 0
	jl done ;; if x_position if off screen on left side, can't go that way. can only go right.
	;; else you CAN go left
	sub myBird.x_position, 5
	lea ebx, angryBird
	INVOKE BasicBlit, ebx, myBird.x_position, myBird.y_position
	sub mySling.x_position, 5
	lea edx, slingshot
	INVOKE BasicBlit, edx, mySling.x_position, mySling.y_position
	INVOKE ResetScreen
	;INVOKE DrawStarField
	lea esi, purple_pig
	INVOKE BasicBlit, esi, myStar.x_position, myStar.y_position
	INVOKE BasicBlit, ebx, myBird.x_position, myBird.y_position
	INVOKE BasicBlit, edx, mySling.x_position, mySling.y_position
	jmp done

go_up: ;;hmm don't know if i want this yet
	mov clicked, 1
	INVOKE ResetScreen
	lea esi, purple_pig
	INVOKE BasicBlit, esi, myStar.x_position, myStar.y_position
	lea edx, slingshot
	INVOKE BasicBlit, edx, mySling.x_position, mySling.y_position

	cmp exploded, 0
	je get_rid_of


get_rid_of:
	cmp myBird.y_position, 0
	jl done2
	;INVOKE DrawStr, OFFSET debug_words, 100, 100, 0ffh
	cmp myBird.y_position, 100
	jl done2 ;; if y_position if off screen at top, can't keep going. 
	;; else you CAN keep going up
	;cmp exploded, 1
	;je done2
	sub myBird.y_position, 10
	lea ebx, angryBird
	INVOKE BasicBlit, ebx, myBird.x_position, myBird.y_position

	lea ecx, purple_pig
	INVOKE CheckIntersect, myBird.x_position, myBird.y_position, ebx, myStar.x_position, myStar.y_position, ecx
	cmp eax, 0 ;; if no overlap --> done!

	je done ;; no overlap: done
	;; else there is overlap: need something to happen. print boom! 
	INVOKE DrawStr, OFFSET collision_words, 250, 30, 0ffh ;; this works hm
	lea ecx, transparent_explosion
	INVOKE BasicBlit, ecx, myStar.x_position, myStar.y_position
	mov exploded, 1
	inc update_score
	jmp done 

done2:
	;INVOKE PlaySound, offset music, 0, SND_FILENAME OR SND_ASYNC OR SND_LOOP ;; not here rip
	mov ebx, mySling.x_position
	mov myBird.x_position, ebx
	mov ebx, mySling.y_position
	sub ebx, 30
	mov myBird.y_position, ebx
	lea ebx, angryBird
	INVOKE BasicBlit, ebx, myBird.x_position, myBird.y_position
	;INVOKE BasicBlit, ebx, 300, 370
	mov exploded, 0
	mov clicked, 0
	ret
done:

	mov exploded, 0
	ret         ;; Do not delete this line!!!

game_over_screen:
	mov eax, 0 ;;clear eax
	mov edi, ScreenBitsPtr ;; initial address of first pixel
	mov ecx, 307200 ;; counter -- size of screen bits array
	REP STOSB
	INVOKE DrawStarField

	cmp score, 0
	jg you_won

	invoke DrawStr, offset game_over_words, 10, 200, 0ffh
	jmp done5

you_won:
	push score
	push offset fmtStrScoreFinal
	push offset outStrScore
	call wsprintf
	add esp, 12
	invoke DrawStr, offset outStrScore, 60, 200, 255
	jmp done5

done5:
