GamePlay ENDP

CheckIntersect PROC USES ebx ecx edx edi esi oneX: DWORD, oneY: DWORD, oneBitmap: PTR EECS205BITMAP, twoX: DWORD, twoY: DWORD, twoBitmap: PTR EECS205BITMAP
	LOCAL one_upper: DWORD, one_lower: DWORD, one_left: DWORD, one_right: DWORD, two_upper: DWORD, two_lower: DWORD, two_left: DWORD, two_right:DWORD, one_width: DWORD, two_width: DWORD, one_height: DWORD, two_height: DWORD
	
	mov eax, 0 ;; clear eax 

	mov ebx, oneBitmap ;; for getting one's width
	mov edi, twoBitmap ;; for getting two's width
	;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;

	mov ecx, (EECS205BITMAP PTR [ebx]).dwWidth ;; one's bitmap.width
	mov one_width, ecx
	mov esi, (EECS205BITMAP PTR [edi]).dwWidth ;; two's bitmap.width
	mov two_width, esi
	shr one_width, 1 ;; one_width = one's bitmap.width/2. remember this for later!
	mov ecx, one_width
	shr two_width, 1 ;; two_width = two's bitmap.width/2. remember this for later!
	mov esi, two_width
	mov edx, oneX 
	sub edx, ecx ;; edx = oneX - bitmap.width/2
	mov one_left, edx
	add esi, twoX ;; esi = twoX + bitmap.width/2
	mov two_right, esi

	;; if 2's right side >= 1's left side, there's overlap. 
	cmp two_right, edx
	;jge check_vert ;; if greater than or equal, gotta check if vertically overlapping. 
	jle NO_OVERLAP ;; if not greater than or equal, then there's no overlap. Don't even check others bc can't be other overlap -- be done.

	mov ecx, one_width ;; remember one_width = one's bitmap.width/2
	mov esi, two_width ;; remember two_width = two's bitmap.width/2

	add ecx, oneX ;; one.x + bitmap.width/2 ;; one's right bound
	mov one_right, ecx

	mov edx, twoX ;; edx <-- twoX 
	sub edx, esi ;; edx = twoX - bitmap.width/2 ;; two's left bound
	mov two_left, edx

	;; if 2's left <= 1's right, there's overlap.
	cmp two_left, ecx
	jle check_vert ;; if less than or equal, gotta check if vertically overlapping
	jmp NO_OVERLAP ;; else if not less than or equal, there's no overlap. Don't even check others bc can't be other overlap -- be done. 

	;; at this point, there's horizontal overlap. but there still could be no overlap of sprites, so need to check.
check_vert:
	mov ecx, (EECS205BITMAP PTR [ebx]).dwHeight ;; one's bitmap.height
	mov esi, (EECS205BITMAP PTR [edi]).dwHeight ;; two's bitmap.height

	shr ecx, 1 ;; one's bitmap.height/2
	mov one_height, ecx ;; one_height = bitmap.height/2. remember this for later!
	shr esi, 1 ;; two's bitmap.height/2
	mov two_height, esi ;; two_height = bitmap.height/2. remember this for later!
	add ecx, oneY ;; ecx = one's bitmap.height/2 + oneY
	mov one_upper, ecx

	mov edx, twoY 
	sub edx, esi ;; edx = twoY - bitmap.height/2
	mov two_lower, edx

	;; 2's lower >= 1's upper, no overlap. else keep checking. 
	cmp two_lower, ecx
	jge NO_OVERLAP
	jmp check_next ;; unecessary, but else case

check_next:
	;; finally, if 1's lower < 2's upper, there's no overlap.
	mov ecx, one_height ;; one's bitmap.height/2
	mov esi, two_height ;; two's bitmap.height/2

	mov edx, oneY
	sub edx, ecx ;; edx = oneY - bitmap.height/2
	mov one_lower, edx
	
	add esi, twoY ;; esi = bitmap.height/2 + twoY
	mov two_upper, esi

	;; if 2's upper >= one's lower, there's overlap! 
	cmp two_upper, edx
	jge OVERLAP
	jmp NO_OVERLAP;; OTHERWISE THERE IS NO OVERLAP! 

OVERLAP:
	mov eax, 1 ;; if nonzero --> yes, there's overlap! 
	jmp done

NO_OVERLAP:
	mov eax, 0 ;; if zero --> no, there's no overlap!
	jmp done ;; unnecessary

done:
	ret
CheckIntersect ENDP


